import React from "react";

import "./NumberPlate.css";
import moment from 'moment';

const NumberPlate = () => {

    const [allPlates, setAllPlates] = useState([]);

    const getAllPlates = async () => {
        try {
            console.log("getAllPosts called");

            const { data } = await api.fetchPosts();

            console.log(data);

            // data.sort((obj1, obj2) => obj1.createdAt - obj2.createdAt);

            setAllPlates(data);
        } catch (error) {
            console.log(error.message);
        }
    };

    useEffect(() => {
        getAllPlates();
    }, []);


    const getTime = (str)=>{
        const t = Date(str);
        return(
            <div>
                {moment(str).fromNow()}
            </div>
        )
    }


    const showNumberPlates = () => {
        return(
            <div>
                <ol>
                    {
                        allPlates.map( (plate) => {return(
                            <li> 
                                <div className="plate">
                                    { plate.numberPlate }
                                </div>

                                <div className="time">
                                    { getTime(plate.createdAt) }
                                </div>
                            </li>
                        )} ).reverse()
                    }
                </ol>
            </div>
        )
    }

    return (
        <div style={{ margin: "2rem" }}>
            <h3>List of Cars Parked</h3>

            {showNumberPlates()}
{/* 
            <div>
                <ol>
                    <li>DL69</li>
                    <li>DL69</li>
                    <li>DL69</li>
                </ol>
            </div> */}
        </div>
    );
};

export default NumberPlate;
